function ExpenseItem(props) {
  const expenseDate = new Date(2022, 7, 8);
  const expenseTitle = "Car Insurance";
  const expenseAmount = 300;

  return (
    <div>
      <div>{props.date}</div>
      <div>
        <h2>{props.title}</h2>
        <div>${props.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
